import React from "react";

const Project = ({ project }) => {
  return (
    <article>
      <span class="image">
        <img src={project.img} alt="tile-background" />
      </span>
      <a href={project.ref} target="_blank">
        <h2>1. Sweet Eats Bakery</h2>
        <div class="content">
          <p>
            This was the first project at Lambda. I was able to practice sematic
            HTML and start using CSS.
          </p>
        </div>
      </a>
    </article>
  );
};

export default Project;
